import styled from 'styled-components/native';
import LogoSrc from '../assets/welcomeTemp.jpg';

export const StyledView = styled.View`
  flex: 1;
  background-color: white;
  align-items: center;
  justify-content: center;
`;

export const LogoDiv = styled.View`
  background-image: url(${LogoSrc});
  height: 100%;
  width: 100%;
`;

export const BttnWrapper = styled.View`
  height: 100%;
  width: 100%;
  margin: auto;
  max-width: 600px;
  position: relative;
`;

export const BttnDiv = styled.View`
  height: auto;
  padding: 20px;
  width: 100%;
  margin: auto;
  bottom: 0;
  max-width: 600px;
  position: absolute;
`;

export const Gradiant = styled.View`
height: 100%;
  width: 100%;
  position: absolute;
  background: #000;
  background-image: linear-gradient(90deg, rgba(255, 255, 255, .3) 0%, rgba(231, 231, 231, .3) 22.39%, rgba(209, 209, 209,  .3) 42.6%, rgba(182, 182, 182, .3) 79.19%, rgba(156, 156, 156, .3) 104.86%);
`;
